(124, 'default', 'bot', 1629040000, NULL, NULL, '{\"event\": \"bot\", \"timestamp\": 1629037141.5677862, \"text\": \"Will I need to do anything to prepare for the test?You will need to take your test about three to four hours after waking up. Prolactin levels change throughout the day, but are usually the highest in early morning.Be sure to tell your health care provider about any medicines you are taking. Certain medicines can raise prolactin levels. These include birth control pills, high blood pressure medicine, and antidepressants.\\n\\n\", \"data\": {\"elements\": null, \"quick_replies\": null, \"buttons\": null, \"attachment\": null, \"image\": null, \"custom\": null}, \"metadata\": {}}'),
