(159, 'default', 'bot', 1629040000, NULL, NULL, '{\"event\": \"bot\", \"timestamp\": 1629037497.132406, \"text\": \"Why do I need a TSH test?You may need a TSH test if you have symptoms of too much thyroid hormone in your blood (hyperthyroidism), or too little thyroid hormone (hypothyroidism).Symptoms of hyperthyroidism, also known as overactive thyroid, include:AnxietyWeight lossTremors in the handsIncreased heart ratePuffinessBulging of the eyesDifficulty sleepingSymptoms of hypothyroidism, also known as underactive thyroid, include:Weight gainTirednessHair lossLow tolerance for cold temperaturesIrregular menstrual periodsConstipation\\n\\n\", \"data\": {\"elements\": null, \"quick_replies\": null, \"buttons\": null, \"attachment\": null, \"image\": null, \"custom\": null}, \"metadata\": {}}'),
