(414, 'default', 'user', 1629080000, 'dosage_drug', NULL, '{\"event\": \"user\", \"timestamp\": 1629082346.5854142, \"text\": \"Can you give me dosage information of Acetaminophen?\", \"parse_data\": {\"intent\": {\"id\": -8293773196108082080, \"name\": \"dosage_drug\", \"confidence\": 0.9982604384422302}, \"entities\": [{\"entity\": \"lab\", \"start\": 38, \"end\": 51, \"confidence_entity\": 0.917961061000824, \"value\": \"Acetaminophen\", \"extractor\": \"DIETClassifier\"}, {\"entity\": \"drug\", \"start\": 38, \"end\": 51, \"value\": \"Acetaminophen\", \"extractor\": \"RegexEntityExtractor\"}], \"text\": \"Can you give me dosage information of Acetaminophen?\", \"message_id\": \"606564793823480ab872857d0cfe847f\", \"metadata\": {}, \"intent_ranking\": [{\"id\": -8293773196108082080, \"name\": \"dosage_drug\", \"confidence\": 0.9982604384422302}, {\"id\": -2496211379734875218, \"name\": \"during_lab\", \"confidence\": 0.0006751163164153695}, {\"id\": -5264818742156466511, \"name\": \"need_lab\", \"confidence\": 0.00023692214745096862}, {\"id\": -6440584015453582741, \"name\": \"warnings_drug\", \"confidence\": 0.00020338113245088607}, {\"id\": -1399908511236100904, \"name\": \"any_detail_lab\", \"confidence\": 0.00019598257495090365}, {\"id\": -995280083535523938, \"name\": \"inform_lab\", \"confidence\": 9.751486504683271e-05}, {\"id\": -6908639268833250972, \"name\": \"detail_lab\", \"confidence\": 9.193476580549031e-05}, {\"id\": -7886868431645239907, \"name\": \"usage_lab\", \"confidence\": 8.928767056204379e-05}, {\"id\": -7627940402759928982, \"name\": \"prepare_lab\", \"confidence\": 7.776697748340666e-05}, {\"id\": -6280356146366946862, \"name\": \"risk_lab\", \"confidence\": 7.16398426447995e-05}], \"response_selector\": {\"all_retrieval_intents\": [], \"default\": {\"response\": {\"id\": null, \"responses\": null, \"response_templates\": null, \"confidence\": 0.0, \"intent_response_key\": null, \"utter_action\": \"utter_None\", \"template_name\": \"utter