(697, '178782135', 'bot', 1629210000, NULL, NULL, '{\"event\": \"bot\", \"timestamp\": 1629214851.9323118, \"metadata\": {\"button_type\": \"inline\"}, \"text\": \"Omeprazole is a proton pump inhibitor that decreases the amount of acid produced in the stomach.\\nOmeprazole is used to treat symptoms of gastroesophageal reflux disease (GERD) and other conditions caused by excess stomach acid. It is also used to promote healing of erosive esophagitis (damage to your esophagus caused by stomach acid).\\nOmeprazole may also be given together with antibiotics to treat gastric ulcer caused by infection with Helicobacter pylori (H. pylori).\\nOver-the-counter (OTC) omeprazole is used in adults to help control heartburn that occurs 2 or more days per week.\\nThe OTC brand of omeprazole must be taken as a course on a regular basis for 14 days in a row.\\n\\n\", \"data\": {\"elements\": null, \"quick_replies\": null, \"buttons\": [{\"payload\": \"/good_response\", \"title\": \"\\ud83d\\udc4d\\ud83c\\udffb\"}, {\"payload\": \"/bad_response\", \"title\": \"\\ud83d\\udc4e\\ud83c\\udffb\"}], \"attachment\": null, \"image\": null, \"custom\": null}}'),
