(707, '178782135', 'bot', 1629220000, NULL, NULL, '{\"event\": \"bot\", \"timestamp\": 1629215299.3208468, \"metadata\": {\"button_type\": \"inline\"}, \"text\": \"Get emergency medical help if you have signs of an allergic reaction to ibuprofen (hives, difficult breathing, swelling in your face or throat) or a severe skin reaction (fever, sore throat, burning eyes, skin pain, red or purple skin rash with blistering and peeling).\\nGet emergency medical help if you have signs of a heart attack or stroke: chest pain spreading to your jaw or shoulder, sudden numbness or weakness on one side of the body, slurred speech, leg swelling, feeling short of breath.\\nStop using this medicine and call your doctor at once if you have:\\nchanges in your vision;\\nshortness of breath (even with mild exertion);\\nswelling or rapid weight gain;\\na skin rash, no matter how mild;\\nsigns of stomach bleeding - bloody or tarry stools, coughing up blood or vomit that looks like coffee grounds;\\nliver problems - nausea, upper stomach pain, itching, tired feeling, flu-like symptoms, loss of appetite, dark urine, clay-colored stools, jaundice (yellowing of the skin or eyes);\\nlow red blood cells (anemia) - pale skin, feeling light-headed or short of breath, rapid heart rate, trouble concentrating; or\\nkidney problems - little or no urinating, painful or difficult urination, swelling in your feet or ankles, feeling tired or short of breath.\\nCommon ibuprofen side effects may include:\\nnausea, vomiting, gas;\\nbleeding; or\\ndizziness, headache.\\nThis is not a complete list of side effects and others may occur. Call your doctor for medical advice about side effects. You may report side effects to FDA at 1-800-FDA-1088.\\n Ibuprofen side effects (more detail)\\n\\n\", \"data\": {\"elements\": null, \"quick_replies\": null, \"buttons\": [{\"payload\": \"/good_response\", \"title\": \"\\ud83d\\udc4d\\ud83c\\udffb\"}, {\"payload\": \"/bad_response\", \"title\": \"\\ud83d\\udc4e\\ud83c\\udffb\"}], \"attachment\": null, \"image\": null, \"custom\": null}}'),
