(737, 'default', 'user', 1629220000, 'dosage_drug', NULL, '{\"event\": \"user\", \"timestamp\": 1629216357.5897694, \"text\": \"Can you give me dosage information of Acetaminophen?\", \"parse_data\": {\"intent\": {\"id\": -1792431492961996793, \"name\": \"dosage_drug\", \"confidence\": 0.9960311651229858}, \"entities\": [{\"entity\": \"lab\", \"start\": 38, \"end\": 51, \"confidence_entity\": 0.6084794402122498, \"value\": \"Acetaminophen\", \"extractor\": \"DIETClassifier\"}, {\"entity\": \"drug\", \"start\": 38, \"end\": 51, \"value\": \"Acetaminophen\", \"extractor\": \"RegexEntityExtractor\"}], \"text\": \"Can you give me dosage information of Acetaminophen?\", \"message_id\": \"6d2aa6634bed4be2a60e861a4ddcf8fe\", \"metadata\": {}, \"intent_ranking\": [{\"id\": -1792431492961996793, \"name\": \"dosage_drug\", \"confidence\": 0.9960311651229858}, {\"id\": 6701530447256896303, \"name\": \"during_lab\", \"confidence\": 0.0023596545215696096}, {\"id\": 7248363969797146468, \"name\": \"affirm\", \"confidence\": 0.00041309604421257973}, {\"id\": -8793842631632817198, \"name\": \"detail_lab\", \"confidence\": 0.00024880541604943573}, {\"id\": -5278335137830181685, \"name\": \"need_lab\", \"confidence\": 0.00024251094146165997}, {\"id\": 4626746755578352773, \"name\": \"result_lab\", \"confidence\": 0.00015971908578649163}, {\"id\": 538866232027685179, \"name\": \"request_lab\", \"confidence\": 0.0001593914785189554}, {\"id\": -2792556765195962476, \"name\": \"greet\", \"confidence\": 0.00013878474419470876}, {\"id\": 8984235623483683545, \"name\": \"any_detail_lab\", \"confidence\": 0.00013144877448212355}, {\"id\": 7353872054912724303, \"name\": \"bot_challenge\", \"confidence\": 0.0001153749180957675}], \"response_selector\": {\"all_retrieval_intents\": [], \"default\": {\"response\": {\"id\": null, \"responses\": null, \"response_templates\": null, \"confidence\": 0.0, \"intent_response_key\": null, \"utter_action\": \"utter_None\", \"template_name\": \"utter_None\"