(954, '178782135', 'bot', 1629230000, NULL, NULL, '{\"event\": \"bot\", \"timestamp\": 1629232079.0329394, \"metadata\": {\"button_type\": \"inline\"}, \"text\": \"What do the results mean?High levels of AST in the blood may indicate hepatitis, cirrhosis, mononucleosis, or other liver diseases. High AST levels can also indicate heart problems or pancreatitis. If your results are not in the normal range, it doesn\'t necessarily mean that you have a medical condition needing treatment. A variety of factors that can affect your results. These include your age, gender, diet, and types of medicines you take. To learn what your results mean, talk to your health care provider.Learn more about laboratory tests, reference ranges, and understanding results.\\n\\n\", \"data\": {\"elements\": null, \"quick_replies\": null, \"buttons\": [{\"payload\": \"/good_response\", \"title\": \"\\ud83d\\udc4d\\ud83c\\udffb\"}, {\"payload\": \"/bad_response\", \"title\": \"\\ud83d\\udc4e\\ud83c\\udffb\"}], \"attachment\": null, \"image\": null, \"custom\": null}}'),
