(1110, 'default', 'bot', 1629340000, NULL, NULL, '{\"event\": \"bot\", \"timestamp\": 1629336721.1387122, \"metadata\": {\"button_type\": \"inline\"}, \"text\": \"Take Abilify exactly as prescribed by your doctor. Follow all directions on your prescription label. Your doctor may occasionally change your dose to make sure you get the best results. Do not take this medicine in larger or smaller amounts or for longer than recommended.\\nDo not take Abilify for longer than 6 weeks unless your doctor has told you to.\\nAbilify can be taken with or without food.\\nSwallow the regular tablet whole and do not crush, chew, or break the tablet. Do not split the Abilify Discmelt orally disintegrating tablet.\\nMeasure liquid medicine with the dosing syringe provided, or with a special dose-measuring spoon or medicine cup. If you do not have a dose-measuring device, ask your pharmacist for one.\\nTo take the orally disintegrating tablet (Discmelt):\\nKeep the tablet in its blister pack until you are ready to take it. Open the package and peel back the foil. Do not push a tablet through the foil or you may damage the tablet.\\nUse dry hands to remove the tablet and place it in your mouth.\\nDo not swallow the tablet whole. Allow it to dissolve in your mouth without chewing. If needed, you may drink liquid to help swallow the dissolved tablet.\\nUse Abilify regularly to get the most benefit. Get your prescription refilled before you run out of medicine completely.\\nYou should not stop using Abilify suddenly. Stopping suddenly may make your condition worse.\\nYour doctor will need to check your progress while you are using this medicine.\\nStore at room temperature away from moisture and heat. Abilify liquid may be used for up to 6 months after opening, but not after the expiration date on the medicine label.\\n Detailed Abilify dosage information\\nWhat happens if I miss a dose?\\nTake the missed dose as soon as you remember. Skip the missed dose if it is almost time for your next scheduled dose. Do not take extra medicine to make up the missed dose.\\nWhat happens if I overdose?\\nSeek emergency medical attention or call the Poison Help line at 1-800-222-1222.\\nOverdose symptoms may include drowsiness, vomiting, aggression, confusion, tremors, fast or slow heart rate, seizure (convulsions), trouble breathing, or fainting.\\n\\n\", \"data\": {\"elements\": null, \"quick_replies\": null, \"buttons\": [{\"payload\": \"/good_response\", \"title\": \"\\ud83d\\udc4d\\ud83c\\udffb\"}, {\"payload\": \"/bad_response\", \"title\": \"\\ud83d\\udc4e\\ud83c\\udffb\"}], \"attachment\": null, \"image\": null, \"custom\": null}}'),
